def myFit(x, offset, time_constant):
    return np.exp(time_constant * (offset - 1e6 * x))

# Define the x values: log10(x) ranging from -7 to 0
x_log_AP = np.linspace(-7.5, -2, 400)
x_values_AP = 10**x_log_AP  # Convert log10(x) back to x

# Calculate y values for the plot
y_values_AP = 1 - myFit(x_values_AP,.02,5.8)

def scatterplot_AP():
    # rect_list is list of tuples <left, right, bottom, top>
    plt.figure(figsize=(12, 9))
    plt.scatter(log_time, global_amplitudes,s=5,marker='o',alpha=0.3)
    plt.plot(x_log_AP, y_values_AP, label='1 - myFit(10^x)', color='blue')
    plt.xlabel('Delay Time (log[s])')
    plt.ylabel('Amplitude (A.u.)')
    plt.show()

def rect_scatterplot(rect_list):
    # rect_list is list of tuples <left, right, bottom, top>
    plt.figure(figsize=(12, 9))
    plt.scatter(log_time, global_amplitudes,s=5,marker='o',alpha=0.3)
    for left_limit, right_limit, lower_limit, upper_limit in rect_list:
        rect = patches.Rectangle((left_limit, lower_limit), right_limit - left_limit, upper_limit - lower_limit,linewidth=.75, edgecolor='red', facecolor='none')
        plt.gca().add_patch(rect)
    
    plt.xlabel('Delay Time (log[s])')
    plt.ylabel('Amplitude (A.u.)')
    plt.show()

def rect_num_waveform(rectangle,name):
    left_limit = rectangle[0]
    right_limit = rectangle[1]
    lower_limit = rectangle[2]
    upper_limit = rectangle[3]

    counter = 0
    for i in range(len(global_amplitudes)):
        amp_bool = lower_limit <= global_amplitudes[i] <= upper_limit
        time_bool = left_limit <= log_time[i] <= right_limit
        if amp_bool and time_bool:
            counter+=1
    print(name,':',counter,'waveforms')

def drop_rect(rectangle,name):
    global log_time
    global global_amplitudes

    rect_scatterplot([rectangle])
    rect_num_waveform(rectangle,name)

    left_limit = rectangle[0]
    right_limit = rectangle[1]
    lower_limit = rectangle[2]
    upper_limit = rectangle[3]

    bad_indices = []
    for i in range(len(global_amplitudes)):
        amp_bool = lower_limit <= global_amplitudes[i] <= upper_limit
        time_bool = left_limit <= log_time[i] <= right_limit
        if amp_bool and time_bool:
            bad_indices.append(i)

    temp_global_amps = []
    temp_log_time = []
    for i in range(len(global_amplitudes)):
        if i not in bad_indices:
            temp_global_amps.append(global_amplitudes[i])
            temp_log_time.append(log_time[i])
    log_time = temp_log_time
    global_amplitudes = temp_global_amps


    rect_scatterplot([rectangle])        



