# Define the function
def myFit(x, offset, time_constant):
    return np.exp(time_constant * (offset - 1e6 * x))

# Initial parameters
initial_offset = .007
initial_time_constant = 5.54

# Create the plot
fig, ax = plt.subplots()
plt.subplots_adjust(bottom=0.35)  # Increase the bottom margin to make room for sliders
x_log_AP = np.linspace(-7.5, -2.3, 400)
x_values_AP = 10**x_log_AP
y_values_AP = 1 - myFit(x_values_AP, initial_offset, initial_time_constant)
line, = ax.plot(x_log_AP, y_values_AP, label='1 - myFit(10^x)', color='red')

# Initial scatterplot
scatter = ax.scatter(log_time, global_amplitudes, s=5, marker='o', alpha=0.3, color='blue')

# Add sliders for interactive input
axcolor = 'lightgoldenrodyellow'
ax_offset = plt.axes([0.25, 0.1, 0.65, 0.03], facecolor=axcolor)
ax_time_constant = plt.axes([0.25, 0.15, 0.65, 0.03], facecolor=axcolor)

slider_offset = Slider(ax_offset, 'Offset', -2.0, 3.0, valinit=initial_offset)
slider_time_constant = Slider(ax_time_constant, 'Time Constant', 2, 15, valinit=initial_time_constant)

# Update function for sliders
def update(val):
    offset = slider_offset.val
    time_constant = slider_time_constant.val
    y_values_AP = 1 - myFit(x_values_AP, offset, time_constant)
    line.set_ydata(y_values_AP)
    # Optional: update the scatterplot data if necessary
    # scatter.set_offsets(np.c_[log_time, global_amplitudes])  # Uncomment if dynamic update is needed
    fig.canvas.draw_idle()

slider_offset.on_changed(update)
slider_time_constant.on_changed(update)

plt.legend()
plt.show()